/IXServerEvents/onBeforeLogin.description:
If the
 user is not allowed to login according to the {@link LoginScriptOptions} opts, an exception has to be thrown.
 <p>
 Example code: <code><pre>
 function onBeforeLogin(ec, user, opts) {
   if (username == "OnlyWithWebClient" &amp;&amp; options.getClientName() != LoginScriptOptionsC.CLIENT_NAME_WEBCLIENT) {
     throw "User may login only with the WebClient";
   }
 }
 </pre></code>
 </p>

/IXServerEvents/onCheckSordAccess.description:
In order to deny access to the given sord, return false, otherwise return true.
 <p>
 This method should not be implemented by services for performance reasons. It is frequently called and should
 perform as fast as possible.
 </p>
 <p>
 The Indexserver's access check function can be called via class de.elo.ix.jscript.Access. Example code: <code><pre>
 function onCheckSordAccess(ec, sord, sordZ, lur, opts) {
   var acc = new Packages.de.elo.ix.jscript.Access();
   var succ = acc.checkAccess(sord, lur);
   return succ;
 } 
 </pre></code>
 </p>

/IXServicePortIF/findFirstUsers.description:
Wildcards can be used as defined in the session options, see {@link SessionOptionsC#DB_WILDCARDS}.
 <p>
 Example:

 <pre>
 <code class="example">
 FindUserInfo findUserInfo = new FindUserInfo();
 findUserInfo.setName("testFind?sers-*");
 int idx = 0, max = 100;
 FindResult fr = conn.ix().findFirstUsers(findUserInfo, max);
 try {
   while (true) {
     for (UserName userName : fr.getUserNames().values()) {
       // process userName object
     }

     if (!fr.isMoreResults()) break;

     idx += fr.getUserNames().length;
     fr = conn.ix().findNextUsers(fr.getSearchId(), idx, max);
   }
 }
 catch (RemoteException e) {
   // process exception
   throw e;
 }
 finally {
   conn.ix().findClose(fr.getSearchId());
 }
 </code>
 </pre>
 </p>
 Additionally, FindResult#sortedResult returns a sorted list of either UserInfo or UserName objects, depending on
 {@link FindUserInfo#returnUserInfoMap}.

EVENT_TYPE_WATCH_FOLDER.description:
Watch folder event. An event of this type is sent, if the contents of a given folder have been changed.
<p>
 In order to register a listener for such events, the folder to be watched has to be specified with an object ID
 expression in <code>EventFilter.param2</code>(see checkoutSord):

 <pre>
 <code>
 IXConnection conn = ...

 // Folder to be watched
 int folderId = ...

 // Register listener  
 conn.getEventBusApi().getBroadcastBus().addListener( 
   EventBusC.EVENT_TYPE_WATCH_FOLDER, 
   Integer.toString(folderId) );
 </code>
 </pre>
 </p>
 <p>
 For each modified Sord object in the watched folder, the client application receives one <code>Event</code>,
 whereby the data members are set as follows:

 <pre>
 <code>
 Event ev = ...

 // Folder being watched
 int folderId = Integer.parseInt(ev.getParam2());

 // Arguments 
 Object[] args = (Object[])AnyToObject.toObject(ev.getAny());

 // Inserted, updated (e.g. locked) or deleted Sord  
 Sord sord = (Sord)args[0];

 // Valid members of args[0]
 SordZ sordMembersZ = (SordZ)args[1];

 // What has happened: EventBusC.WATCH_INSERT, EventBusC.WATCH_UPDATE, EventBusC.WATCH_DELETE
 int what = (Integer)args[2]; 
 </code>
 </pre>
 </p>
 <p>
 Watch folder events are sent to every current acitve connection, provided that a listener was registered for it and
 the associated user has at least read access to the changed object. It is also sent to the connection that fires
 this event.
 </p>

